import React from "react";
import "../style/ranga.css";


function Gamespace(props) {
    return (
        <div className="container">
            <div className="row">
                <div className="col-lg-1"></div>
                <div className="jumbotron rounded">
                    <div className="container">
                        <div className="row center">


                            {props.children}


                        </div>
                    </div>
                </div>

            </div>
        </div>
    );
}

export default Gamespace;
